<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>TVClub Online</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Roboto:wght@400;700&display=swap" rel="stylesheet">
    <style>

        /*--------------
          Basic styles
        --------------*/
        :root {
            --btn-fontSize: 39px;
        }

        * {
            margin: 0;
            padding: 0;
            outline: none;
            text-decoration: none;
            box-sizing: border-box;
        }

        html, body {
            height: 100%;
        }

        body {
            color: #fff;
            font-family: 'Roboto', sans-serif;
            background-color: #000000;
            -webkit-text-size-adjust: 100%;
            overflow: hidden;
        }

        .container {
            margin: 0 auto;
        }

        a {
            color: inherit;
        }


        /*--------------
             Header
        --------------*/

        header .container {
            display: flex;
            max-width: 550px;
            align-items: center;
            justify-content: center;
            background: #686363;
            min-height: 55px;
        }

        header .container p {
            text-align: center;
            font-style: normal;
            font-weight: normal;
            font-size: 36px;
            line-height: 42px;
            color: #FFFFFF;
        }



        /*--------------
              Main
        --------------*/
        main {
            height: 100%;
            text-align: center;
        }

        main .container {
            max-width: 550px;
            height: 100%;
            display: flex;
            justify-content: flex-start;
            flex-direction: column;
        }

        .main-image {
            display: flex;
            align-items: flex-end;
            justify-content: center;
            margin-top: 42px;

        }

        .main-image img {
            width: 68%;
            margin: 0 auto;
        }

        .button {
            margin-top: 10px;
        }

        .button h2 {
            margin: 4px 0 14px;
            font-style: normal;
            font-weight: bold;
            font-size: 36px;
            line-height: 42px;
            text-align: center;
            color: #FFFFFF;
        }

        .button p {
            margin-bottom: 43px;
            font-style: normal;
            font-weight: bold;
            font-size: 28px;
            line-height: 33px;
            text-align: center;
            color: #FFFFFF;
        }

        .btn {
            width: 355px;
            min-height: 78px;
            margin: 0 auto;
            display: flex;
            align-items: center;
            justify-content: center;
            font-style: normal;
            font-weight: bold;
            font-size: 48px;
            line-height: 56px;
            text-align: center;
            color: #FFFFFF;
            background-color: #00D500;
        }


        /*!*--------------*/
        /*     Media*/
        /*--------------*!*/





        @media (max-width: 570px) {
            main .container {
                max-width: 90%;
            }
        }

        @media (max-width: 400px) {
            .btn {
                max-width: 90%;
            }
        }

        @media (max-height: 749px) {

        }

        @media
         (max-height: 640px)
        and (max-width: 550px)
            {
            .main-image {
                margin-top: 10px;
            }
            .button h2 {
                font-size: 30px;
                line-height: 1;
            }
            .button p {
                font-size: 24px;
                line-height: 1;
                margin-bottom: 18px;
            }
        }

        @media (max-height: 540px)
        and (max-width: 550px)
         {
            .main-image img {
                width: 40%;
            }
        }

        @media (max-height: 459px)
        and (max-width: 550px)
         {
            main .container {
                height: 85%;
                justify-content: center;
            }
            .main-image {
                display: none;
                margin-top: 0;
            }
            .button h2 {
                font-size: 27px;
                line-height: 1;
            }
            .button p {
                font-size: 18px;
                line-height: 1;
                margin-bottom: 18px;
            }
            .button {
                margin-top: 0;
            }
        }

        @media (max-width: 410px)
        and (max-height: 400px){

        }

        @media (min-height: 750px) {
            main .container {
                height: 85%;
                justify-content: center;
            }
        }

    </style>
</head>
